import React, { Component } from "react";
import Navigation from "../Navbar";
import { Jumbotron, InputGroup, Button, FormControl } from "react-bootstrap";
import image from "../../images/pizza.png";

class UserHome extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <Navigation></Navigation>
        <Jumbotron
          style={{
            backgroundImage: `url(${image})`,
            backgroundRepeat: "no-repeat"
          }}
        >
          <h1 className="d-flex justify-content-center">
            Who delivers your favourite food?
          </h1>
          <div className="d-flex justify-content-center">
            <InputGroup
              size="lg"
              className="d-flex justify-content-center col-sm-8"
            >
              <InputGroup.Prepend>
                <InputGroup.Text id="inputGroup-sizing-lg">
                  <i class="search icon"></i>
                </InputGroup.Text>
              </InputGroup.Prepend>

              <FormControl
                aria-label="Large"
                placeholder="Search with item"
                aria-describedby="inputGroup-sizing-sm"
              ></FormControl>
              <FormControl
                aria-label="Large"
                aria-describedby="inputGroup-sizing-sm"
                placeholder="Search with Cuisine"
              />

              <InputGroup.Append>
                <Button variant="primary">Find Food</Button>
              </InputGroup.Append>
            </InputGroup>
          </div>
        </Jumbotron>
      </div>
    );
  }
}

export default UserHome;
